import { Button, Grid } from "@mui/material";
import { GoogleLogin } from "@react-oauth/google";
import * as React from "react";
import BasicCard from "./BasicCard";

function Login() {
  return (
    <div>
      <Grid container>
        <Grid
          xs={12}
          sx={{
            display: "flex",
            flexDirection: "row",
            flexWrap: "wrap",
            justifyContent: "center",
            marginTop: "100px",
          }}
        >
          <div>
            <BasicCard>
              <h1>Login</h1>
              <Button sx={{ marginTop: 10 }} size="large">
                Sign in with Google
              </Button>
              <p>or</p>
              <Button size="large">Continue as Guest</Button>
              <GoogleLogin
                onSuccess={(credentialResponse) => {
                  console.log(credentialResponse);
                }}
                onError={() => {
                  console.log("Login Failed");
                }}
              />
            </BasicCard>
          </div>
        </Grid>
      </Grid>
    </div>
  );
}
export default Login;
